class HourBtn extends React.Component {
    state= {
        modal9: false,
        modal10: false,
        booked9: false,
        booked10: false,
        booked11: false,
        booked12: false,
        booked13: false,
        booked14: false,
        booked15: false,
        booked16: false,
        booked17: false,
        FullName9: '',
        FullName10: '',
        FullName11: '',
        FullName12: '',
        FullName13: '',
        FullName14: '',
        FullName15: '',
        FullName16: '',
        FullName17: '',
        PhoneNumb9: '',
        PhoneNumb10: '',
        PhoneNumb11: '',
        PhoneNumb12: '',
        PhoneNumb13: '',
        PhoneNumb14: '',
        PhoneNumb15: '',
        PhoneNumb16: '',
        PhoneNumb17: ''
    }

    toggle = nr => () => {
        let modalNumber = 'modal' + nr
        this.setState({
          [modalNumber]: !this.state[modalNumber]
        });
    }

    submit = nr => () => {
        let bookedNumber = 'booked' + nr
        this.setState({
          [bookedNumber]: true
        });
    }


    handleChange = (event) => {
        this.setState({
            [event.target.name]: event.target.value
        })
        console.log('hi')

    }


    render() {
        return (
            <Container className="DisplayHours">
                <Row >
                    <Col xs="2" sm="2" md="2" lg="2" className="time">
                        <Button  onClick={this.toggle(9)} className={`rounded-circle hourBtn booked-${this.state.booked9}`} >9 AM</Button>
                        <Modal isOpen={this.state.modal9} toggle={this.toggle(9)} className="modal-dialog-centered">
                            <ModalHeader toggle={this.toggle(9)}>Schedule Appointment</ModalHeader>
                            <ModalBody>
                                <Form>
                                    <FormGroup row>
                                        <Label for="exampleFullName" sm={1}><i className="fa fa-user prefix"></i></Label>
                                        <Col sm={11}>
                                            <Input type="text" name="FullName9" id="exampleFullName" placeholder="Full Name" onChange={this.handleChange} value={this.state.FullName9} />
                                        </Col>
                                    </FormGroup>
                                    <FormGroup row>
                                        <Label for="examplePhone" sm={1}><i className="fas fa-phone"></i></Label>
                                        <Col sm={11}>
                                            <Input type="text" name="PhoneNumb9" id="examplePhone" placeholder="Phone Number" onChange={this.handleChange} value={this.state.PhoneNumb9} />
                                        </Col>
                                    </FormGroup>
                                </Form>
                            </ModalBody>
                            <ModalFooter>
                                <Button   color="primary" onClick={this.submit(9)}>Submit</Button>
                                <Button color="secondary" onClick={this.toggle(9)}>Cancel</Button>
                            </ModalFooter>
                        </Modal>              
                    </Col>
                    <Col xs="2" sm="2" md="2" lg="2" className="time">
                        <Button  onClick={this.toggle(10)} className={`rounded-circle hourBtn booked-${this.state.booked9}`} >10 AM</Button>
                        <Modal isOpen={this.state.modal10} toggle={this.toggle(10)} className="modal-dialog-centered">
                            <ModalHeader toggle={this.toggle(10)}>Schedule Appointment</ModalHeader>
                            <ModalBody>
                                <Form>
                                    <FormGroup row>
                                        <Label for="exampleFullName" sm={1}><i className="fa fa-user prefix"></i></Label>
                                        <Col sm={11}>
                                            <Input type="text" name="FullName9" id="exampleFullName" placeholder="Full Name" onChange={this.handleChange} value={this.state.FullName9} />
                                        </Col>
                                    </FormGroup>
                                    <FormGroup row>
                                        <Label for="examplePhone" sm={1}><i className="fas fa-phone"></i></Label>
                                        <Col sm={11}>
                                            <Input type="text" name="PhoneNumb9" id="examplePhone" placeholder="Phone Number" onChange={this.handleChange} value={this.state.PhoneNumb9} />
                                        </Col>
                                    </FormGroup>
                                </Form>
                            </ModalBody>
                            <ModalFooter>
                                <Button   color="primary" onClick={this.submit(9)}>Submit</Button>
                                <Button color="secondary" onClick={this.toggle(9)}>Cancel</Button>
                            </ModalFooter>
                        </Modal>              
                    </Col>

                    {/* <Col xs="2" sm="2" md="2" lg="2" className="time">
                            <ModalBtn Submit={this.submit11} 
                                      handleToggle={this.toggle}
                                      modalState={this.state.modal} 
                                      changeEvent={this.handleChange}
                                      status={this.state.booked11}
                                      name="FullName11"
                                      Phone="PhoneNumb11"
                                      FullName={this.state.FullName11}
                                      PhoneNumb={this.state.PhoneNumb11} 
                                      buttonLabel="10AM" />
                    </Col> */}
                </Row>
            </Container>
    );
  }
}

export default HourBtn;
